script: |
  super -f text -I q292.spq | sort > q292.out

inputs:
  - name: q292.spq
    data: |
      SELECT col0 / - col0 / col1 * - - col1 * + CAST ( col1 AS INTEGER ) AS col1, + col2 / col0 * - 82 AS col0 FROM tab2 (FORMAT parquet) WHERE 77 NOT BETWEEN - col2 AND - col0 * + - col1;
  - name: tab2

outputs:
  - name: q292.out
    data: |
